this["templates"]["homeTemplate"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"content-header\">\r\n    <div class=\"overlay-dark cover rb\"\r\n         data-rb-image=\"dist/img/rb/wonder-woman\"\r\n         data-rb-image-filetype=\"jpg\"\r\n         data-rb-sizes=\"800,1024,1200,1920,3840\"\r\n         data-rb-aspect-ratio=\"16by9\"\r\n         data-rb-current=\"800\"\r\n         style=\"background-position: center 36%; background-image:url(dist/img/rb/wonder-woman-800.jpg)\">\r\n        <div>\r\n            <span class=\"title\">Wonder Woman</span>\r\n            <span class=\"author\">DC Comics</span>\r\n            <div class=\"position bottom left\"><div>test</div></div>\r\n            <div class=\"position bottom right\"><div>test</div></div>\r\n            <div class=\"position top left\"><div>test</div></div>\r\n            <div class=\"position top right\"><div>test</div></div>\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"content\">\r\n    <div>\r\n        <section>\r\n            <h3>Introduction</h3>\r\n            <div class=\"alert theme-info\">\r\n                <div>\r\n                    <ul class=\"list\">\r\n                        <li>The goal with this website is to make a dynamic layout, with all the features a modern website should have, that works in all browsers and on all devices.</li>\r\n                        <li>Inspired by <a href=\"http://getbootstrap.com/\" target=\"_blank\" rel=\"noopener\">Bootstrap</a> and <a href=\"https://foundation.zurb.com\" target=\"_blank\" rel=\"noopener\">Foundation</a>.</li>\r\n                    </ul>\r\n                </div>\r\n            </div>\r\n        </section>\r\n        <section>\r\n            <h3>Some of the features</h3>\r\n            <div class=\"alert\">\r\n                <div>\r\n                    <ul class=\"list\">\r\n                        <li>\r\n                            <b>Keyboard controls</b> is disabled when loading is shown.\r\n                            <ul>\r\n                                <li><b>Left arrow key</b> if modal isn't shown it opens settings or closes navigation if it is open.</li>\r\n                                <li><b>Right arrow key</b> if modal isn't shown it opens navigation or closes settings if it is open.</li>\r\n                                <li><b>ESC key</b> closes modal or aside, authentication, popups and dropdowns.</li>\r\n                                <li><b>TAB</b> toggles authentication, modal, aside, dropdown if focused element is within/outside of it.</li>\r\n                                <li><b>ENTER</b> toggles authentication, checkbox, radio, dropdown, accordion item, navigation tree item if it has focus.</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li><b>Local storage</b> is used to save navigation and settings.</li>\r\n                        <li><b>Modal</b> for image keeps aspect ratio and always fills entire width or height of screen.</li>\r\n                        <li><b>Tables</b> can be flipped without any javascript.</li>\r\n                        <li><b>REM</b> is used for everything instead of EM or PX. REM gets converted to PX for breakpoints, since browsers can't handle REM in breakpoints correctly.</li>\r\n                        <li><b>Media queries</b> based on layout elements instead of just browser window width.</li>\r\n                        <li><b>SVG icons</b> with fill color that can be set in SCSS.</li>\r\n                        <li><b>Hover effects</b> is only applied for desktop browsers, since mobiles can't display them correctly.</li>\r\n                        <li><b>Responsive design</b> that works down to around 300x300px.</li>\r\n                        <li><b>Focus</b> is applied to all inputs for accessibility.</li>\r\n                        <li><b>Scroll</b> is disabled for the site, when displaying modal, aside without shrink and loading.</li>\r\n                        <li><b>Transitions</b> works in all browsers by using margin/padding alternatives to calc(), since Edge/IE can't handle transitions with calc().</li>\r\n                        <li>\r\n                            <b>Android</b>\r\n                            <ul>\r\n                                <li><b>Modal</b> image shrinks/grows, when androids top bar is shown/hidden.</li>\r\n                                <li>\r\n                                    <b>Swipe controls</b> is disabled when loading or modal is shown or when horizontally scrolling.\r\n                                    <ul>\r\n                                        <li><b>Swipe left</b> opens settings or closes navigation if it is open.</li>\r\n                                        <li><b>Swipe right</b> opens navigation or closes settings if it is open.</li>\r\n                                    </ul>\r\n                                </li>\r\n                            </ul>\r\n                        </li>\r\n                    </ul>\r\n                </div>\r\n            </div>\r\n        </section>\r\n        <section>\r\n            <h3>Settings</h3>\r\n            <div class=\"alert\">\r\n                <div class=\"flex space-2\">\r\n                    <p>Settings work by applying classes to html and saving it in local storage.</p>\r\n                    <ul class=\"list\">\r\n                        <li>\r\n                            <b>Fixed footer</b>\r\n                            <ul>\r\n                                <li><b>Enabled</b>: Footer is fixed at bottom of screen.</li>\r\n                                <li><b>Disabled</b>: Footer is shown below content.</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li>\r\n                            <b>Two columns</b> is disabled untill screen is wide enough.\r\n                            <ul>\r\n                                <li><b>Enabled</b>: Content is displayed in two columns.</li>\r\n                                <li><b>Disabled</b>: Content is displayed in one column.</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li>\r\n                            <b>Transitions</b>\r\n                            <ul>\r\n                                <li><b>Enabled</b>: Layout uses transitions.</li>\r\n                                <li><b>Disabled</b>: Layout doesn't use transitions.</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li>\r\n                            <b>Signed in</b>\r\n                            <ul>\r\n                                <li><b>Enabled</b>: Displays \"User\" in header.</li>\r\n                                <li><b>Disabled</b>: Displays \"Register\" and \"Login\" buttons in header.</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li>\r\n                            <b>Android swipe</b>\r\n                            <ul>\r\n                                <li><b>Enabled</b>: Aside can be opened/closed by swiping horizontally on the screen.</li>\r\n                                <li><b>Disabled</b>: Aside can't be opened/closed by swiping horizontally on the screen.</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li>\r\n                            <b>Theme</b> can be switched between light and dark.\r\n                            Only the selected theme will be loaded at initial page load, before the page gets displayed.\r\n                        </li>\r\n                        <li>\r\n                            <b>Aside</b>\r\n                            <ul>\r\n                                <li><b>Overlay</b>: Aside opens on top of content.</li>\r\n                                <li><b>Push</b>: Aside pushes content.</li>\r\n                                <li><b>Shrink</b>: Aside shrinks content. (uses \"Overlay\" untill screen is wide enough)</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li>\r\n                            <b>Close on click outside</b> is always enabled when aside isn't shrinking content.\r\n                            <ul>\r\n                                <li><b>Enabled</b>: Close aside when clicking outside it, unless target is loading, modal or popup.</li>\r\n                                <li><b>Disabled</b>: Don't close aside when clicking outside it.</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li>\r\n                            <b>Close on page change</b>\r\n                            <ul>\r\n                                <li><b>Enabled</b>: Close aside when changing page</li>\r\n                                <li><b>Disabled</b>: Don't close aside when changing page.</li>\r\n                            </ul>\r\n                        </li>\r\n                    </ul>\r\n                </div>\r\n            </div>\r\n        </section>\r\n        <section>\r\n            <h3>Acknowledgement</h3>\r\n            <div class=\"alert\">\r\n                <div>\r\n                    <ul class=\"list\">\r\n                        <li>\r\n                            <b>Visual Studio</b>\r\n                            <ul>\r\n                                <li><b>Web Compiler by Mads Kristensen</b> is used to convert SCSS to CSS with sourcemap and minified version.</li>\r\n                                <li><b>Bundler & Minifier by Mads Kristensen</b> is used to combine and minify JS.</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li><b>SPA by Rafael Pedicini</b> is used to make the website into a Single-Page-Application.</li>\r\n                        <li><b>Maps by Google</b> is used to make maps.</li>\r\n                        <li><b>loadCSS by Filament Group</b> is used to load CSS.</li>\r\n                        <li><b>Lazy by Eisbehr</b> is used to load images.</li>\r\n                        <li><b>Bowser by Dustin Diaz</b> is used to determinate user browser and device.</li>\r\n                        <li><b>Tooltipster by Caleb Jacob</b> is used to make tooltips.</li>\r\n                        <li><b>KaTeX by Khan Academy</b> is used to display mathematics.</li>\r\n                        <li><b>Validate by Jörn Zaefferer</b> is used for form validation.</li>\r\n                        <li><b>sortable by Lebedev Konstantin</b> is used for drag and drop.</li>\r\n                        <li><b>Plyr by Sam Potts</b> is used to make audio/video players.</li>\r\n                        <li><b>DataTables by Allan Jardine</b> is used to make advanced tables.</li>\r\n                    </ul>\r\n                </div>\r\n            </div>\r\n        </section>\r\n        <section>\r\n            <h3>Browser support</h3>\r\n            <div class=\"flex space-2\">\r\n                <p>The site has been optimized for the newest version of these browsers:</p>\r\n                <div>\r\n                    <div id=\"browsers\" class=\"flex column wrap center space-2\">\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-browser-chrome\"></use></svg></i>\r\n                                <span class=\"title\">Google</span>\r\n                                <span>Chrome</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-browser-firefox\"></use></svg></i>\r\n                                <span class=\"title\">Mozilla</span>\r\n                                <span>Firefox</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-browser-edge\"></use></svg></i>\r\n                                <span class=\"title\">Microsoft</span>\r\n                                <span>Edge</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-browser-ie\"></use></svg></i>\r\n                                <span class=\"title\">Microsoft</span>\r\n                                <span>Internet Explorer</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-browser-safari\"></use></svg></i>\r\n                                <span class=\"title\">Apple</span>\r\n                                <span>Safari</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-browser-opera\"></use></svg></i>\r\n                                <span class=\"title\">Opera</span>\r\n                                <span>Opera</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-browser-uc\"></use></svg></i>\r\n                                <span class=\"title\">UCWeb</span>\r\n                                <span>UC Browser</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-browser-internet\"></use></svg></i>\r\n                                <span class=\"title\">Samsung</span>\r\n                                <span>Internet</span>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </section>\r\n        <section>\r\n            <h3>Platform support</h3>\r\n            <div class=\"flex space-3\">\r\n                <p>The site has been optimized for these platforms:</p>\r\n                <div>\r\n                    <div id=\"platforms\" class=\"flex column wrap center space-2\">\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-windows\"></use></svg></i>\r\n                                <span class=\"title\">Microsoft</span>\r\n                                <span>Windows</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-android\"></use></svg></i>\r\n                                <span class=\"title\">Google</span>\r\n                                <span>Android</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <i><svg focusable=\"false\"><use xlink:href=\"#svg-ios\"></use></svg></i>\r\n                                <span class=\"title\">Apple</span>\r\n                                <span>macOS / iOS</span>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </section>\r\n        <section>\r\n            <h3>Lighthouse</h3>\r\n            <div class=\"flex space-3\">\r\n                <p>Results from 23 January 2018:</p>\r\n                <div>\r\n                    <div id=\"lighthouse\" class=\"flex column wrap center space-2\">\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <div class=\"percentage-circle p64 theme-warning\">\r\n                                    <span>64</span>\r\n                                    <div class=\"slice\">\r\n                                        <div class=\"bar\"></div>\r\n                                        <div class=\"fill\"></div>\r\n                                    </div>\r\n                                </div>\r\n                                <span>Progressive Web App</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <div class=\"percentage-circle p87 theme-success\">\r\n                                    <span>82</span>\r\n                                    <div class=\"slice\">\r\n                                        <div class=\"bar\"></div>\r\n                                        <div class=\"fill\"></div>\r\n                                    </div>\r\n                                </div>\r\n                                <span>Performance</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <div class=\"percentage-circle p100 theme-success\">\r\n                                    <span>100</span>\r\n                                    <div class=\"slice\">\r\n                                        <div class=\"bar\"></div>\r\n                                        <div class=\"fill\"></div>\r\n                                    </div>\r\n                                </div>\r\n                                <span>Accessibility</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <div class=\"percentage-circle p100 theme-success\">\r\n                                    <span>100</span>\r\n                                    <div class=\"slice\">\r\n                                        <div class=\"bar\"></div>\r\n                                        <div class=\"fill\"></div>\r\n                                    </div>\r\n                                </div>\r\n                                <span>Best Practices</span>\r\n                            </div>\r\n                        </div>\r\n                        <div>\r\n                            <div class=\"flex center space-2\">\r\n                                <div class=\"percentage-circle p100 theme-success\">\r\n                                    <span>100</span>\r\n                                    <div class=\"slice\">\r\n                                        <div class=\"bar\"></div>\r\n                                        <div class=\"fill\"></div>\r\n                                    </div>\r\n                                </div>\r\n                                <span>SEO</span>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <ul class=\"list\">\r\n                    <li>\r\n                        <b>Progressive Web App</b>: would get a 100% score if the website used ServiceWorker,\r\n                        but I could not get it to work correctly. The ServiceWorker cached everything forever and could only be refreshed by deleting it in the browser.\r\n                    </li>\r\n                    <li>\r\n                        <b>Performance</b>: fluctuates in the score, based on where and when you run the test.\r\n                    </li>\r\n                </ul>\r\n            </div>\r\n        </section>\r\n        <section>\r\n            <h3>GTmetric</h3>\r\n            <div class=\"flex space-3\">\r\n                <p>Results from 23 January 2018:</p>\r\n                <div>\r\n                    <div id=\"gtmetric\" class=\"flex column grow wrap space-3\">\r\n                        <div class=\"flex\">\r\n                            <h5>Performance Scores</h5>\r\n                            <div class=\"alert\">\r\n                                <div class=\"flex column grow wrap space-8\">\r\n                                    <div>\r\n                                        <h6>PageSpeed Score</h6>\r\n                                        <div class=\"flex column vertical-center score space-2\">\r\n                                            <span class=\"grade\">A</span>\r\n                                            <span class=\"number\">(94%)</span>\r\n                                            <i class=\"arrow\">\r\n                                                <svg focusable=\"false\"><use xlink:href=\"#svg-arrow\"></use></svg>\r\n                                            </i>\r\n                                        </div>\r\n                                    </div>\r\n                                    <div>\r\n                                        <h6>YSlow Score</h6>\r\n                                        <div class=\"flex column vertical-center score space-2\">\r\n                                            <span class=\"grade\">A</span>\r\n                                            <span class=\"number\">(91%)</span>\r\n                                            <i class=\"arrow\">\r\n                                                <svg focusable=\"false\"><use xlink:href=\"#svg-arrow\"></use></svg>\r\n                                            </i>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"flex\">\r\n                            <h5>Page Details</h5>\r\n                            <div class=\"alert\">\r\n                                <div class=\"flex column grow wrap space-8\">\r\n                                    <div>\r\n                                        <h6>Fully Loaded Time</h6>\r\n                                        <div class=\"flex column vertical-center score space-2\">\r\n                                            <span class=\"large\">0.5s</span>\r\n                                            <i class=\"arrow\">\r\n                                                <svg focusable=\"false\"><use xlink:href=\"#svg-arrow\"></use></svg>\r\n                                            </i>\r\n                                        </div>\r\n                                    </div>\r\n                                    <div>\r\n                                        <h6>Total Page Size</h6>\r\n                                        <div class=\"flex column vertical-center score space-2\">\r\n                                            <span class=\"large\">228KB</span>\r\n                                            <i class=\"arrow\">\r\n                                                <svg focusable=\"false\"><use xlink:href=\"#svg-arrow\"></use></svg>\r\n                                            </i>\r\n                                        </div>\r\n                                    </div>\r\n                                    <div class=\"flex\">\r\n                                        <h6>Requests</h6>\r\n                                        <div class=\"flex column vertical-center score space-2\">\r\n                                            <span class=\"large\">18</span>\r\n                                            <i class=\"arrow\">\r\n                                                <svg focusable=\"false\"><use xlink:href=\"#svg-arrow\"></use></svg>\r\n                                            </i>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </section>\r\n    </div>\r\n</div>\r\n";
},"useData":true});
